module.exports = {
    extends: 'stylelint-config-standard',
    rules: {
        'comment-empty-line-before': [
            'always',
            {
                except: ['first-nested'],
                ignoreComments: ['/rtl:.*/'],
            },
        ],
        // NOTE: the intention here is that all our CSS rules have a single
        // class name in the selector that identifies the  component. Whenever
        // we need to target "the instance of a child component inside a parent"
        // use `:where(.ag-parent) .ag-child` to reduce the specificity.
        //
        // We allow state selectors like :focus and .ag-disabled on top of this,
        // because we want them to be slightly more specific. If for example a
        // component .ag-foo has a default color and a focus color, we want
        // `.ag-foo { color: black }` to set the default colour without also
        // removing the focus effect.
        'selector-max-specificity': [
            '0,1,0',
            {
                // add selectors here only if they refer to states, rather than components
                ignoreSelectors: [
                    '/^:/',
                    '[disabled]',
                    ':not(:disabled)',
                    '[readonly]',
                    '.ag-animating',
                    '.ag-disabled',
                    '.ag-selected',
                    '.ag-not-selected',
                    '.ag-checked',
                    '.ag-cell-inline-editing',
                    '.ag-row-hover',
                    '.ag-row-selected',
                    '.ag-picker-has-focus',
                    '.ag-sticky-label',
                    '.ag-header-cell-wrap-text',
                    '.ag-tab-selected',
                    '.ag-column-select-column-readonly',
                    '.ag-column-select-column-group-readonly',
                    '.ag-active-item',
                    '.ag-layout-print',
                    '.ag-layout-normal',
                    '.ag-layout-auto-height',
                ],
            },
        ],

        // NOTE: In general we want to avoid targeting grid elements using
        // [class^='ag-'] as customer applications can have elements with that
        // prefix too. Sometimes it is unavoidable, e.g. for global style
        // resets, in which case scope the selector so it is only applied within
        // the grid root.
        'selector-disallowed-list': [
            ['/.*class\\^=.*/'],
            {
                message:
                    'Avoid selectors that target partial classnames unless absolutely necessary - see note in .stylelintrc.js',
                severity: 'error',
            },
        ],
    },
};

const esbuild = require('esbuild');
const { umdWrapper } = require('esbuild-plugin-umd-wrapper');
const fs = require('fs/promises');
const path = require('path');

const exportedNames = {
    react: 'React',
    'react-dom': 'ReactDOM',
    'ag-grid-community': 'agGrid',
    'ag-grid-enterprise': 'agGrid',
    'ag-grid-react': 'AgGridReact',
};

/** @type {import('esbuild').Plugin} */
const postBuildMinificationPlugin = {
    name: 'minification-plugin',
    setup(build) {
        build.initialOptions.metafile = true;

        /** @type {Map<string, AbortController>} */
        const writeState = new Map();

        /** @param {string} outputFile */
        const minifyFile = async (outputFile) => {
            try {
                if (outputFile.endsWith('.map')) return;

                writeState.get(outputFile)?.abort();
                const abortController = new AbortController();
                writeState.set(outputFile, abortController);

                const { signal } = abortController;

                const contents = await fs.readFile(path.resolve(outputFile), 'utf-8');

                if (signal.aborted) return;
                const minified = await esbuild.transform(contents, {
                    minify: true,
                    sourcemap: true,
                });

                if (signal.aborted) return;
                const { name, ext } = path.parse(outputFile);
                const minifiedFile = path.resolve(path.dirname(outputFile), `${name}.min${ext}`);
                await Promise.all([
                    fs.writeFile(minifiedFile, minified.code, { signal }),
                    fs.writeFile(`${minifiedFile}.map`, minified.map, { signal }),
                ]);
            } catch (e) {
                if (e.name !== 'AbortError') throw e;
            }
        };

        build.onEnd(async (result) => {
            await Promise.all(Object.keys(result.metafile.outputs).map(minifyFile));
        });
    },
};

/** @type {import('esbuild').Plugin} */
const umdWrapperAdaptorPlugin = {
    name: 'umd-wrapper-adaptor',
    setup(build) {
        const { initialOptions } = build;

        // Creates UMD banner + footer config.
        const exportedName = exportedNames[process.env.NX_TASK_TARGET_PROJECT];
        const umdWrapperInstance = umdWrapper({ libraryName: exportedName });
        umdWrapperInstance.setup(build);

        // Correct global variable name references.
        const { banner } = build.initialOptions;
        for (const external of initialOptions.external ?? []) {
            const globalName = exportedNames[external];
            if (globalName) {
                banner.js = banner.js.replaceAll(`g["${external}"]`, `g["${globalName}"]`);
            }
        }

        // Add `require()` function which uses resolved module references.
        const externalsMap =
            initialOptions.external?.map((e, i) => {
                return `if (name === '${e}') return __d${String.fromCharCode(97 + i)};`;
            }) ?? [];

        build.initialOptions.banner.js += `
if (typeof require === 'undefined') {
    function require(name) {
        ${externalsMap.join('\n        ')}
        throw new Error('Unknown module: ' + name);
    }
}
        `;
    },
};

const plugins = [];
let outExtension = {};
if (process.env.NX_TASK_TARGET_TARGET?.endsWith('umd')) {
    plugins.push(umdWrapperAdaptorPlugin);
    outExtension = {
        '.cjs': '.js',
    };
} else {
    outExtension = {
        '.cjs': '.cjs.js',
        '.js': '.esm.mjs',
    };
}

plugins.push(postBuildMinificationPlugin);

/** @type {import('esbuild').BuildOptions} */
const options = {
    outExtension,
    plugins,
};

module.exports = options;

import pluginJs from '@eslint/js';
import eslintImportX from 'eslint-plugin-import-x';
import globals from 'globals';
import tseslint from 'typescript-eslint';

export default [
    { languageOptions: { globals: { ...globals.browser, ...globals.node } } },
    pluginJs.configs.recommended,
    ...tseslint.configs.recommended,
    { plugins: { 'import-x': eslintImportX } },
    {
        ignores: ['node_modules/', 'dist/', '.astro/', '**/env.d.ts'],
    },
    {
        rules: {
            '@typescript-eslint/no-explicit-any': 'off',
            '@typescript-eslint/consistent-type-imports': [
                'error',
                {
                    prefer: 'type-imports',
                    fixStyle: 'separate-type-imports',
                },
            ],
            'import-x/consistent-type-specifier-style': 'error',
            '@typescript-eslint/no-this-alias': 'off',
            '@typescript-eslint/no-unused-vars': [
                'error',
                {
                    argsIgnorePattern: '^_',
                    varsIgnorePattern: '^_+$',
                },
            ],
            'no-undef': 'warn',
        },
    },
    {
        // cypress uses a global API based on undefined variables
        files: [
            '**/*.spec.{ts,js}',
            '**/*test.{ts,js}',
            '**/{cypress,_copiedFromCore,__tests__}/**',
            '**/test-utils/**',
        ],
        rules: {
            'no-undef': 'off',
        },
    },
];

{
  "$schema": "./node_modules/nx/schemas/nx-schema.json",
  "plugins": [
    "./plugins/ag-grid-task-autogen",
    {
      "plugin": "@nx/vite/plugin",
      "options": {
        "buildTargetName": "build",
        "testTargetName": "vite:test",
        "serveTargetName": "serve",
        "previewTargetName": "preview",
        "serveStaticTargetName": "serve-static"
      }
    }
  ],
  "affected": {
    "defaultBase": "latest"
  },
  "namedInputs": {
    "default": ["{projectRoot}/**/*", "sharedGlobals"],
    "defaultExcludes": [
      "buildOutputExcludes",
      "!{projectRoot}/.eslintrc.*",
      "!{projectRoot}/**/?(*.)+(spec|test).[jt]s?(x)?(.snap)",
      "!{projectRoot}/**/test/**",
      "!{projectRoot}/**/__image_snapshots__/**",
      "!{projectRoot}/tsconfig.spec.json",
      "!{projectRoot}/jest.config.[jt]s"
    ],
    "buildOutputExcludes": ["!{projectRoot}/dist/**"],
    "production": [
      "default",
      "defaultExcludes",
      "!{projectRoot}/**/?(*.)+(spec|test).[jt]s?(x)?(.snap)",
      "!{projectRoot}/tsconfig.spec.json"
    ],
    "tsDeclarations": [
      {
        "dependentTasksOutputFiles": "**/*.d.ts",
        "transitive": false
      }
    ],
    "jsOutputs": [
      {
        "dependentTasksOutputFiles": "**/*.js",
        "transitive": false
      }
    ],
    "styleOutputs": [
      {
        "dependentTasksOutputFiles": "**/*.*css",
        "transitive": true
      }
    ],
    "allOutputs": [
      {
        "dependentTasksOutputFiles": "**/*",
        "transitive": false
      }
    ],
    "allTransitiveOutputs": [
      {
        "dependentTasksOutputFiles": "**/*",
        "transitive": true
      }
    ],
    "tsDefaults": [
      "{projectRoot}/package.json",
      "{projectRoot}/src/**/*",
      "{projectRoot}/tsconfig.*.json",
      "tsDeclarations",
      "sharedGlobals",
      "defaultExcludes",
      {
        "externalDependencies": ["npm:typescript", "npm:esbuild"]
      }
    ],
    "sharedGlobals": ["{workspaceRoot}/esbuild.config*.cjs", "{workspaceRoot}/tsconfig.*.json"],
    "charts": ["chartsPackages", "chartsTypes"],
    "chartsPackages": [
      { "externalDependencies": ["ag-charts-locale", "ag-charts-community", "ag-charts-enterprise"] },
      { "runtime": "date -r ./node_modules/ag-charts-locale/dist \"+%Y-%m-%d %H:%M:%S\"" },
      { "runtime": "date -r ./node_modules/ag-charts-community/dist \"+%Y-%m-%d %H:%M:%S\"" },
      { "runtime": "date -r ./node_modules/ag-charts-enterprise/dist \"+%Y-%m-%d %H:%M:%S\"" }
    ],
    "chartsTypes": [
      {
        "externalDependencies": ["ag-charts-types", "ag-charts-locale", "ag-charts-community", "ag-charts-enterprise"]
      },
      { "runtime": "date -r ./node_modules/ag-charts-locale/dist \"+%Y-%m-%d %H:%M:%S\"" },
      { "runtime": "date -r ./node_modules/ag-charts-types/dist \"+%Y-%m-%d %H:%M:%S\"" },
      { "runtime": "date -r ./node_modules/ag-charts-community/dist \"+%Y-%m-%d %H:%M:%S\"" },
      { "runtime": "date -r ./node_modules/ag-charts-enterprise/dist \"+%Y-%m-%d %H:%M:%S\"" }
    ]
  },
  "targetDefaults": {
    "build": {
      "dependsOn": ["^build"],
      "inputs": ["production", "^production"],
      "cache": true
    },
    "build:types": {
      "dependsOn": ["^build:types"],
      "inputs": ["production", "^production"],
      "cache": true
    },
    "build:package": {
      "dependsOn": ["^build:package"],
      "inputs": ["production", "^production"],
      "cache": true
    },
    "build:umd": {
      "dependsOn": ["build:package", "^build:package"],
      "inputs": ["^jsOutputs"],
      "cache": true
    },
    "build:styles": {
      "dependsOn": ["^build:styles"],
      "inputs": ["production", "^production"],
      "cache": true
    },
    "lint": {
      "inputs": ["default", "{workspaceRoot}/.eslintrc.json", "{workspaceRoot}/.eslintignore"],
      "cache": true
    },
    "test": {
      "inputs": ["default", "buildOutputExcludes", "^production", "{workspaceRoot}/jest.preset.js"],
      "outputs": [],
      "cache": true
    },
    "e2e": {
      "inputs": ["default", "buildOutputExcludes", "^production"],
      "outputs": [],
      "cache": true
    },
    "pack": {
      "inputs": ["allTransitiveOutputs"],
      "cache": true
    },
    "@nx/jest:jest": {
      "inputs": ["default", "^production", "{workspaceRoot}/jest.preset.js"],
      "cache": true,
      "options": {
        "passWithNoTests": true
      },
      "configurations": {
        "ci": {
          "ci": true,
          "codeCoverage": true
        }
      }
    },
    "@nx/vite:test": {
      "cache": true,
      "inputs": ["default", "^production"]
    }
  },
  "defaultProject": "all"
}
